import React, { useState } from 'react'

function testHooks() {
  const [techs, setTechs] = useState(['ReactJS', 'React native'])

  return (
    <>
      <ul>
        {techs.map((tech) => (
          <li key={tech}>{tech}</li>
        ))}
      </ul>
      <button onClick={handleAdd}>Adicionar</button>
    </>
  )
}

export default testHooks
